import './App.css';
import AIToolList from './components/AIToolList';

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <h1>AI Tools App</h1>
        <div>
          <a href="/">Home</a>
          <a href="/categories">Categories</a>
        </div>
      </nav>
      <header className="App-header">
        <div className="hero">
        </div>
        <AIToolList />
      </header>
    </div>
  );
}

export default App;
